import "./chart.css";
import {
  LineChart,
  Line,
  XAxis,
  YAxis,
  CartesianGrid,
  Tooltip,
  Legend,
  ResponsiveContainer,
} from "recharts";

const VMdata = [
    {
      name: "Last Week",
    "Active VMs": 1247,
    "Inactive VMs": 1253,
    },
    {
      name: "Monday",
    "Active VMs": 1258,
    "Inactive VMs": 1242,
    },
    {
      name: "Tuesday",
    "Active VMs": 1150,
    "Inactive VMs": 1350,
    },
    {
      name: "Wednesday",
    "Active VMs": 1240,
    "Inactive VMs": 1260,
    },
    {
      name: "Thursday",
    "Active VMs": 1250,
    "Inactive VMs": 1250,
    },
    {
      name: "Friday",
    "Active VMs": 1600,
    "Inactive VMs": 900,
    },
    {
        name: "Weekends",
    "Active VMs": 0,
    "Inactive VMs": 0,
      }
  ];

  const NetworkData = [
    {
        name: "Last Week",
    "Active Network": 402,
    "Inactive Network": 198,
    },
    {
      name: "Monday",
    "Active Network": 221,
    "Inactive Network": 379,
    },
    {
      name: "Tuesday",
    "Active Network": 426,
    "Inactive Network": 174,
    },
    {
      name: "Wednesday",
    "Active Network": 475,
    "Inactive Network": 125,
    },
    {
      name: "Thursday",
    "Active Network": 218,
    "Inactive Network": 382,
    },
    {
      name: "Friday",
    "Active Network": 296,
    "Inactive Network": 204,
    },
    {
      name: "Weekends",
    "Active Network": 0,
    "Inactive Network": 0,
      }
  ];





export default function Chart() {
    return (
        <div className="chart">
            <h3 className="chartTitle">Virtual Machines</h3>
            <ResponsiveContainer width="100%" aspect= {6 / 1}>
                <LineChart data={VMdata}>
                    <XAxis dataKey="name" stroke="teal" />
                    <Line type="natural" dataKey="Active VMs" stroke ="green" />
                    <Line type="natural" dataKey="Inactive VMs" stroke ="red" />
                    <Tooltip />
                </LineChart>
            </ResponsiveContainer>

            <h3 className="chartTitle">Network</h3>
            <ResponsiveContainer width="100%" aspect= {6 / 1}>
                <LineChart data={NetworkData}>
                    <XAxis dataKey="name" stroke="teal" />
                    <Line type="natural" dataKey="Active Network" stroke ="green" />
                    <Line type="natural" dataKey="Inactive Network" stroke ="red" />
                    <Tooltip />
                </LineChart>
            </ResponsiveContainer>
        </div>
    )
}
